-- public.npo definition

-- Drop table

-- DROP TABLE npo;

CREATE TABLE npo (
	npo_id int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY,
	parent_id int4 NULL,
	tip_npo_id int4 NOT NULL,
	"name" varchar(50) NOT NULL,
	name2 varchar(255) NULL,
	obj_id int4 NULL,
