-- public.scheme definition

-- Drop table

-- DROP TABLE scheme;

CREATE TABLE scheme (
	"_id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY,
	parent_id int4 NOT NULL,
	parent_tip_npo_id int4 NULL,
	parent_npo_id int4 NULL,
	tip_npo_id int4 NOT NULL,
	ctip varchar(100) NULL,
	nam varchar(100) NULL,
	npo_id int4 NOT NULL,
	fl_sx int4 NOT NULL,
	CONSTRAINT scheme_pk PRIMARY KEY (_id),
	CONSTRAINT scheme_fk1 FOREIGN KEY (tip_npo_id) REFERENCES tip_npo(tip_npo_id),
	CONSTRAINT scheme_fk2 FOREIGN KEY (npo_id) REFERENCES npo(npo_id),
	CONSTRAINT scheme_fk3 FOREIGN KEY (parent_npo_id) REFERENCES npo(npo_id),
	CONSTRAINT scheme_fk4 FOREIGN KEY (parent_tip_npo_id) REFERENCES tip_npo(tip_npo_id)
);
COMMENT ON TABLE public.scheme IS 'Таблица Схема';


